import React from 'react';
import logo from './logo.svg';
// import './App.css';
import Title from './Components/Title';
import Form from './Components/Form';
const API_KEY = "8fd8acf9a851ceb137378de3bd7d6a7c";
function App() {
    getWeather = async () => {
        const api_call = await fetch(`http://api.openweathermap.org/data/2.5/weather?q=Brisbane,au&appid=${API_KEY}&units=metric`);
        const data = await api_call.json();
        console.log(data);

    }
    return (
        <div className="App">
            <Title/>
            <Form/>
        </div>
    );
}

export default App;
